import AddStudent from './components/AddStudent'
import Header from './components/Header'
import { StudentList } from './components/StudentList'
import { useState } from 'react'

function App() {
  const [students, setStudents] = useState([
    {
      name: 'Jan Kowalski',
      description: 'Opis Jana Kowalskiego',
      mail: 'Jan.Kowalski@mail.com',
      tags: [
        { tagName: 'tag11' },
        { tagName: 'tag12' },
        { tagName: 'tag13' }
      ]
    },
    {
      name: 'Stefan Nowak',
      description: 'Opis Stefana Nowaka',
      mail: 'Stefan.Nowak@mail.com',
      tags: [
        { tagName: 'tag21' },
        { tagName: 'tag22' },
        { tagName: 'tag23' }
      ]

    },
    {
      name: 'Janusz Janusz',
      description: 'Opis Janusza Janusza',
      mail: 'Janusz.Janusz@mail.com',
      tags: [
        { tagName: 'tag31' },
        { tagName: 'tag32' },
        { tagName: 'tag33' }
      ]

    },
  ])

  return (
    <div className="App">
      <Header />
      <AddStudent />
      <StudentList students={students}/>
    </div>
  );
}

export default App;
